      .brand--head, .brand--head *   { font-family: 'Lato' !important; }
      .brand--body, .brand--body *   { font-family: 'Merriweather' !important; }
      .brand--lhead, .brand--lhead * { font-family: 'Lato' !important; }
      .brand--lbody, .brand--lbody * { font-family: 'Merriweather' !important; }
      .brand--ui, .brand--ui *       { font-family: 'Lato' !important; }

      .brand--beforeHead:before { font-family: 'Lato' !important; }
      .brand--afterHead:after { font-family: 'Lato' !important; }

      .brand--background        { background-color: #007856 !important; }
      .brand--background-all *  { background-color: #007856 !important; }
      .brand--border            { border-color: #007856 !important; }
      .brand--color             { color: #007856 !important; }
      .brand--color-all *       { color: #007856 !important; }
      .brand--shadow            { box-shadow: 0 0 0 0.2rem #007856 !important; }
      .brand--shadow-all *      { box-shadow: 0 0 0 0.2rem #007856 !important; }
      .brand--fill              { fill: #007856 !important; }
      .brand--stroke            { stroke: #007856 !important; }

      .brand--beforeBackground:before { background-color: #007856 !important; }
      .brand--beforeBorder:before     { border-color: #007856 !important; }
      .brand--beforeColor:before      { color: #007856 !important; }

      .brand--afterBackground:after { background-color: #007856 !important; }
      .brand--afterBorder:after     { border-color: #007856 !important; }
      .brand--afterColor:after      { color: #007856 !important; }

      /* should be applied to containers where links
         need to appear in brand color */
      .brand--linkColor a { color: #007856 !important; }

      /* should be applied to containers where links
         need to change to brand color on hover */
      .brand--linkColorHover a:hover { color: #007856 !important; }

      /* should be applied to any single element that
         needs to change color on hover */
      .brand--hoverColor:hover { color: #007856 !important; }

      /* TODO: probably need a way to create a 5-10% darker/lighter color */
      .brand--linkColor a:hover,
      .button.brand--background:hover { opacity: .65 !important; }

      @media (min-width: 47.9375em) { /* 768px */
        .brand--min768--background { background-color: #007856 !important; }
        .brand--min768--border     { border-color: #007856 !important; }
        .brand--min768--color      { color: #007856 !important; }
      }

      @media (max-width: 47.9375em) { /* 768px */
        .brand--max768--background { background-color: #007856 !important; }
        .brand--max768--border     { border-color: #007856 !important; }
        .brand--max768--color      { color: #007856 !important; }
      }
